declare type Fraction = [number, number];
export interface DurationValue {
    empty: boolean;
    value: number;
    name: string;
    fraction: Fraction;
    shorthand: string;
    dots: string;
    names: string[];
}
export declare function names(): string[];
export declare function shorthands(): string[];
export declare function get(name: string): DurationValue;
export declare const value: (name: string) => number;
export declare const fraction: (name: string) => Fraction;
declare const _default: {
    names: typeof names;
    shorthands: typeof shorthands;
    get: typeof get;
    value: (name: string) => number;
    fraction: (name: string) => Fraction;
};
export default _default;
